import React from 'react';
import Image from 'react-image-resizer';

import code from '../assets/img/code2.jpg'
import '../App.css';

{/* About page */}

function About() {
    const imageStyle = {
        float: 'right',
      };
    return (
        <div>
             <Image
          src={code}
          height={740}
          width={640}
          style={imageStyle}
        />
            <p className="App-style">
            Since 2019, we have been providing users and clients the best  <br></br>
            experience when it comes to our product suite. At ToUpper LLC,  <br></br>
            we pride and distinguish ourselves by using the most cutting <br></br>
            edge technology and efficient techniques when developing  <br></br>
            applications. We strive to produce the most elegant and <br></br>
            easy-to-use applications for our clients to enhance their <br></br> 
            business.
            </p>

            <p className="App-style"> 
            During our planning process, we strategize to map out a <br></br>
            robust project timeline in order to make sure that your <br></br>
            desired launch date is met. In order to ensure that your <br></br> application is customer ready, we profusely test our applications to ensure the highest level of security is applied, iron out any bugs, and solve any issues that may arise during implementation. We also offer publishing services once your project is completed, as well as any maintenance that your application may require. If you are interested in cloud deployment or other cloud services, we will be happy to consult with you to determine the best possible outcome.
            </p>

            <p className="App-style"> Let the geeks help! We know creating a website isn't easy, so let us do <br></br>
            the hard work for you. Please contact us and provide any questions  <br></br>
            or comments you may have! We will be happy to provide a free first <br></br> 
            consultation.
            </p>
      </div>
    );
}

export default About;
